    @Override
    /*为了分页, 需要在房源列表基础上, 额外返回总数*/
    public Map mapFind(String url){
        Map map = new HashMap();
        int totalNum = 0;
        /* 解析url 拿到检索条件参数 */
        HouseParam houseParam = decodeUrl(url);
        /* 检索条件可能包括 中介或个人，这是两个表，则有必要分情况考虑： 中介、个人、中介加个人*/
        List<HousePart> list = new ArrayList<HousePart>();
        if(houseParam.getType()!=null) {
            switch (houseParam.getType()){
                case "b1":
                    if(houseParam.getCompany()!=null){
                        totalNum = 0;
                    }else {
                        list = housedetailMapper.findUserHouse(houseParam);
                        totalNum = housedetailMapper.findUserHouseTotal(houseParam);
                    }
                    break;
                case "b2":
                    list = housedetailMapper.findAgentHouse(houseParam);
                    totalNum = housedetailMapper.findAgentHouseTotal(houseParam);
                    break;
            }
        }else if (houseParam.getCompany()!=null){
            list = housedetailMapper.findAgentHouse(houseParam);
            totalNum = housedetailMapper.findAgentHouseTotal(houseParam);
        }
        else{
            list = housedetailMapper.findBoth(houseParam);
            totalNum = housedetailMapper.findBothTotal(houseParam);
        }
        map.put("house",list);
        map.put("totalNum",totalNum);
        System.out.println(map);
        return map;
    }

