    /* 对 请求的URL 进行解析，得到检索参数（区域，其它检索条件）*/
    public HouseParam decodeUrl(String url){
        System.out.println("url: "+url);
        String district = null;
        String paramUrl = null;
        HouseParam houseParam = new HouseParam();

        /* 截取出 区域编码   以及  后面的检索参数条件*/
        int regionIndex = url.indexOf('/');
        if(regionIndex!=-1){
            district = url.substring(0,regionIndex);
            houseParam.setDistrict(district);               //设置邮政编码 作为地区的唯一标识
            paramUrl = url.substring(regionIndex+1);
        }else{
            paramUrl = url;
        }

        System.out.println(district + " " + paramUrl);

        String[] params = paramUrl.trim().split("-");
        int paramLength = params.length-1;
//       页数,用于分页查找
        int pageNum = Integer.parseInt(params[params.length-1]);
        if(pageNum<1)
            pageNum = 1;
        houseParam.setPageNum(pageNum);

        System.out.println("来自HouseSearchImpl : 当前页: " + pageNum);
        String param = "";
        for(int j = 0; j < paramLength;j++){
            param = params[j];
            System.out.println("param " +param);
            //检索参数起码为2位如t**, 否则不纳入考虑
            if(param.trim().length()>1) {
                switch (param.charAt(0)) {
                    //价格参数解析
                    case 'p':
                        switch (param) {
                            case ("p60"):
                                houseParam.setPriceMin(0);
                                houseParam.setPriceMax(60);
                                break;
                            case ("p90"):
                                houseParam.setPriceMin(60);
                                houseParam.setPriceMax(90);
                                break;
                            case ("p120"):
                                houseParam.setPriceMin(90);
                                houseParam.setPriceMax(120);
                                break;
                            case ("p150"):
                                houseParam.setPriceMin(120);
                                houseParam.setPriceMax(150);
                                break;
                            case ("p200"):
                                houseParam.setPriceMin(150);
                                houseParam.setPriceMax(200);
                                break;
                            case ("p201"):
                                houseParam.setPriceMin(200);
                                houseParam.setPriceMax(10000);
                                break;
                        }
                        break;
                    //室（房间）数解析
                    case 'r':
                        switch (param) {
                            case ("r1"):
                                houseParam.setRoomNum(1);
                                break;
                            case ("r2"):
                                houseParam.setRoomNum(2);
                                break;
                            case ("r3"):
                                houseParam.setRoomNum(3);
                                break;
                            case ("r4"):
                                houseParam.setRoomNum(4);
                                break;
                            case ("r5"):
                                houseParam.setRoomNum(5);
                                break;
                            case ("r6"):
                                houseParam.setRoomNum(6);
                                break;
                        }
                        break;
                    //面积参数解析
                    case 's':
                        switch (param) {
                            case ("s50"):
                                houseParam.setSizeMin(0);
                                houseParam.setSizeMax(50);
                                break;
                            case ("s70"):
                                houseParam.setSizeMin(50);
                                houseParam.setSizeMax(70);
                                break;
                            case ("s90"):
                                houseParam.setSizeMin(70);
                                houseParam.setSizeMax(90);
                                break;
                            case ("s110"):
                                houseParam.setSizeMin(90);
                                houseParam.setSizeMax(110);
                                break;
                            case ("s130"):
                                houseParam.setSizeMin(110);
                                houseParam.setSizeMax(130);
                                break;
                            case ("s150"):
                                houseParam.setSizeMin(130);
                                houseParam.setSizeMax(150);
                                break;
                            case ("s200"):
                                houseParam.setSizeMin(150);
                                houseParam.setSizeMax(200);
                                break;
                            case ("s300"):
                                houseParam.setSizeMin(200);
                                houseParam.setSizeMax(300);
                                break;
                            case ("s301"):
                                houseParam.setSizeMin(300);
                                houseParam.setSizeMax(10000);
                                break;
                        }
                        break;
                    //特色标签解析,这个特殊一些,因为可能有一个或多个标签，且不一定连续，如t1_t3,那么t1t2t3就检索不到,
                    //按下面方法可以做到，如果检索条件只有一个标签，那么就模糊匹配；多个标签则全匹配
                    //如 单个标签t1 可以被t1t2t3模糊匹配到. 而两个以上标签t1_t3先转化为 t1t0t3 的格式,再去做全匹配（即完全相等）
                    case 't':
                        String[] str = param.trim().split("_");
                        String[] myTag = {"%","%","%"};
                        String newTag="";
                        if(str.length>1){
                            for(int i = 1;i < 4; i++){
                                for(String s: str){
                                    System.out.println(s);
                                    System.out.println("t"+i);
                                    if(s.equals("t"+i)){
                                        myTag[i-1] = s;
                                        break;
                                    }
                                }
                                newTag+=myTag[i-1];
                            }
                        }else{
                            newTag = str[0];
                        }
                        houseParam.setTag(newTag);
                        break;
                    //所属机构解析
                    case 'c':
                        houseParam.setCompany(param.substring(1));
                        break;
                    //房子朝向解析
                    case 'f':
                        houseParam.setFaceAt(param.substring(1));
                        break;
                    //楼层解析
                    case 'l':
                        houseParam.setFloor(param.substring(1));
                        break;
                    //装修解析
                    case 'z':
                        houseParam.setDecoration(param.substring(1));
                        break;
                    //排序方式解析: 1为时间升序，2为时间降序；3为价格升序，4为价格降序；5为面积升序，6为面积降序
                    case 'o':
                        houseParam.setOrderType(Integer.parseInt(param.substring(1)));
                        break;
                    //个人还是中介房源？
                    case 'b':
                        houseParam.setType(param);
                        break;
                    default:
                        break;
                }
            }
        }
        System.out.println(houseParam);
        return houseParam;
    }
